import React from "react";

function Contact() {
    return (
        <div id="contact" className="container px-5 py-10 text-center lg:px-40 mx-auto">
            <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-white">
              Contact
            </h1>
            <p className="lg:w-2/3 mx-auto leading-relaxed text-base">
              If you have any enquiries, please use the contact form below
            </p>
            <form name="contact" method="post">
            <div class="mb-6">

            {/* Name Start */}
            <input type="text" id="base-input" class="bg-gray-800 border border-gray-300 text-white text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full pl-10 p-2.5 my-6"/>
            </div>
            {/* Name End */}

            {/* Email Start */}
            <div className="relative mb-6 mx-auto">
            <div className="absolute inset-y-0 left-0 flex items-center pl-3.5 pointer-events-none">
                <svg className="w-4 h-4 text-gray-500" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 20 16">
                <path d="m10.036 8.278 9.258-7.79A1.979 1.979 0 0 0 18 0H2A1.987 1.987 0 0 0 .641.541l9.395 7.737Z"/>
                <path d="M11.241 9.817c-.36.275-.801.425-1.255.427-.428 0-.845-.138-1.187-.395L0 2.6V14a2 2 0 0 0 2 2h16a2 2 0 0 0 2-2V2.5l-8.759 7.317Z"/>
                </svg>
            </div>
            <input type="text" id="email-address-icon" class="bg-gray-800 border border-gray-300 text-white text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full pl-10 p-2.5" placeholder="Email Address"/>
            </div>
            {/* Email End */}

            {/* Message Start */}
            <div className="my-3 mx-auto">
                <textarea id="message" rows="4" class="block p-2.5 w-full text-sm text-white bg-gray-800 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500 " placeholder="Your message here..."></textarea>
            </div>
            {/* Message End */}

           {/* Button Start */}
                <div className="my-3 mx-auto">
                    <input className="rounded-full bg-[#025] p-2 font-itim hover:text-yellow-300 hover:underline decoration-wavy decoration-3 text-blue-200 cursor-pointer" type="submit" value="Submit message" />
                </div>
            {/* Button End */}
            </form>
        </div>
      );
}

export default Contact;
